# https://leetcode.com/problems/is-subsequence/


class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:        
        if s in t:
            return True

        checker = ""

        for i in range(len(t)):
            if( t[i] in s and (t[i] not in checker or s[len(checker)] == t[i])):
                checker += (t[i])

        
        return True if checker == s else False  

